def fraction_path_to_total_path (list): #modified slightly for each case for simplicity
    new_list = []
    for i in list:
        if (i is -1):
            new_list.append(0)
        else:
            new_list.append(i - list[0])
    total_path = list[len(list)-1]-list[0]

    for i in range(len(new_list)):
        if (new_list[i] < 0):
            new_list[i] = 0
        new_list[i] /= total_path

    return new_list

def get_pos_diff(list1, list2):
    new_list = []
    for i in range(len(list1)):
        new_list.append(list1[i]-list2[i])
    print(new_list)
    print (np.std(new_list)**2)


def up(list):
    new_list = []
    for i in range(len(list)-1):
        if (i is 0):
            new_list.append(list[0])
        val = list[i];
        if (list[i] < new_list[i-1]):
            val = new_list[i-1]+7*random.uniform(0, 1)

        new_list.append(val)
    return new_list

